import { useState } from 'react';
import { Button } from './ui/button.tsx';
import { Card, CardContent } from './ui/card.tsx';
import { Avatar } from './ui/avatar.tsx';
import { Badge } from './ui/badge.tsx';
import { Input } from './ui/input.tsx';
import { 
  Heart, 
  MessageCircle, 
  Share, 
  Search, 
  Users,
  Calendar,
  MapPin,
  Clock
} from 'lucide-react';

interface Musician {
  id: string;
  name: string;
  username: string;
  bio: string;
  avatar: string;
  instruments: string[];
  genres: string[];
  experience: 'Beginner' | 'Intermediate' | 'Advanced' | 'Professional';
  location: string;
  isAvailable: boolean;
  followers: number;
  following: number;
  projects: number;
}

interface Post {
  id: string;
  musician: Musician;
  content: string;
  type: 'collaboration' | 'showcase' | 'looking-for' | 'jam-session';
  media?: {
    type: 'audio' | 'video' | 'image';
    url: string;
    duration?: string;
  };
  tags: string[];
  likes: number;
  comments: number;
  timestamp: string;
  isLiked: boolean;
}

interface FeedProps {
  posts: Post[];
  currentUser: Musician;
}

export function Feed({ posts, currentUser }: FeedProps) {
  const [selectedFilter, setSelectedFilter] = useState<string>('all');
  const [likedPosts, setLikedPosts] = useState<Set<string>>(new Set());

  const handleLike = (postId: string) => {
    setLikedPosts(prev => {
      const newSet = new Set(prev);
      if (newSet.has(postId)) {
        newSet.delete(postId);
      } else {
        newSet.add(postId);
      }
      return newSet;
    });
  };

  const filteredPosts = posts.filter(post => {
    return selectedFilter === 'all' || post.type === selectedFilter;
  });

  return (
    <div className="max-w-2xl mx-auto p-4">
      {/* Header */}
      <header className="flex justify-between items-center py-4 border-b border-gray-200">
        <h1 className="text-xl font-bold text-purple-600">MusicConnect</h1>
        <button className="flex items-center text-gray-600">
          <svg xmlns="http://www.w3.org/2000/svg" width="18" height="18" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
            <path d="M9 21H5a2 2 0 0 1-2-2V5a2 2 0 0 1 2-2h4"></path>
            <polyline points="16 17 21 12 16 7"></polyline>
            <line x1="21" y1="12" x2="9" y2="12"></line>
          </svg>
          <span className="ml-1">Sign Out</span>
        </button>
      </header>

      {/* Feed Title */}
      <div className="mt-6 mb-4">
        <div className="flex items-center justify-between">
          <div>
            <h2 className="text-2xl font-bold text-gray-900">Feed</h2>
            <p className="text-gray-600 text-sm">Discover what's happening in the music community</p>
          </div>
          <Avatar>
            <img src={currentUser.avatar} alt={currentUser.name} className="rounded-full w-10 h-10" />
          </Avatar>
        </div>
      </div>

      {/* Search */}
      <div className="relative mb-4">
        <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 w-4 h-4 text-gray-400" />
        <Input placeholder="Search posts, musicians, or tags..." className="pl-10 bg-gray-50 border border-gray-200" />
      </div>
      
      {/* Filter Tabs */}
      <div className="flex mb-4 overflow-x-auto pb-2 gap-2">
        <button 
          onClick={() => setSelectedFilter('all')}
          className={`whitespace-nowrap px-3 py-1 rounded-full text-sm font-medium ${
            selectedFilter === 'all' ? 'bg-blue-500 text-white' : 'bg-gray-100 text-gray-700'
          }`}
        >
          All Posts
        </button>
        <button 
          onClick={() => setSelectedFilter('collaboration')}
          className={`whitespace-nowrap px-3 py-1 rounded-full text-sm font-medium flex items-center ${
            selectedFilter === 'collaboration' ? 'bg-blue-500 text-white' : 'bg-gray-100 text-gray-700'
          }`}
        >
          <Users className="w-3 h-3 mr-1" /> Collaborations
        </button>
        <button 
          onClick={() => setSelectedFilter('showcase')}
          className={`whitespace-nowrap px-3 py-1 rounded-full text-sm font-medium ${
            selectedFilter === 'showcase' ? 'bg-blue-500 text-white' : 'bg-gray-100 text-gray-700'
          }`}
        >
          Showcases
        </button>
        <button 
          onClick={() => setSelectedFilter('looking-for')}
          className={`whitespace-nowrap px-3 py-1 rounded-full text-sm font-medium flex items-center ${
            selectedFilter === 'looking-for' ? 'bg-blue-500 text-white' : 'bg-gray-100 text-gray-700'
          }`}
        >
          <Search className="w-3 h-3 mr-1" /> Looking For
        </button>
        <button 
          onClick={() => setSelectedFilter('jam-session')}
          className={`whitespace-nowrap px-3 py-1 rounded-full text-sm font-medium flex items-center ${
            selectedFilter === 'jam-session' ? 'bg-blue-500 text-white' : 'bg-gray-100 text-gray-700'
          }`}
        >
          <Calendar className="w-3 h-3 mr-1" /> Jam Sessions
        </button>
      </div>

      {/* Posts */}
      <div className="space-y-4">
        {filteredPosts.map((post) => (
          <Card key={post.id} className="border border-gray-200 shadow-sm rounded-lg overflow-hidden">
            <CardContent className="p-4">
              {/* Post Header */}
              <div className="flex items-start justify-between mb-3">
                <div className="flex items-center">
                  <div className="flex-shrink-0 mr-3">
                    <div className="w-10 h-10 bg-gray-200 rounded-full overflow-hidden">
                      <img 
                        src={post.musician.avatar} 
                        alt={post.musician.name} 
                        className="w-full h-full object-cover"
                      />
                    </div>
                  </div>
                  <div>
                    <div className="flex items-center gap-2">
                      <h3 className="text-base font-medium">{post.musician.name}</h3>
                      <span className="bg-blue-100 text-blue-800 text-xs px-2 py-0.5 rounded">
                        {post.musician.experience}
                      </span>
                    </div>
                    <div className="text-sm text-gray-500">{post.musician.username}</div>
                    <div className="flex items-center text-xs text-gray-500 mt-0.5">
                      <MapPin className="w-3 h-3 mr-1" />
                      <span>{post.musician.location}</span>
                      <span className="mx-1">•</span>
                      <Clock className="w-3 h-3 mr-1" />
                      <span>{post.timestamp}</span>
                    </div>
                  </div>
                </div>
                <div>
                  <span className="bg-blue-100 text-blue-800 text-xs px-2 py-1 rounded-full">
                    Collaboration
                  </span>
                </div>
              </div>

              {/* Post Content */}
              <p className="text-gray-800 mb-3">{post.content}</p>

              {/* Instruments/Tags */}
              <div className="flex flex-wrap gap-1 mb-3">
                {post.musician.instruments.map((instrument) => (
                  <Badge key={instrument} variant="secondary" className="bg-gray-100 text-gray-700 border-none">
                    {instrument}
                  </Badge>
                ))}
                {post.tags.map((tag) => (
                  <Badge key={tag} variant="outline" className="border-gray-200">
                    #{tag}
                  </Badge>
                ))}
              </div>

              {/* Post Actions */}
              <div className="flex items-center justify-between pt-2 border-t border-gray-100">
                <div className="flex items-center space-x-4">
                  <button 
                    className="flex items-center text-gray-500"
                    onClick={() => handleLike(post.id)}
                  >
                    <Heart className={`w-4 h-4 mr-1 ${(likedPosts.has(post.id) || post.isLiked) ? 'fill-red-500 text-red-500' : ''}`} />
                    <span>{post.likes + (likedPosts.has(post.id) ? 1 : 0)}</span>
                  </button>
                  <button className="flex items-center text-gray-500">
                    <MessageCircle className="w-4 h-4 mr-1" />
                    <span>{post.comments}</span>
                  </button>
                  <button className="flex items-center text-gray-500">
                    <Share className="w-4 h-4 mr-1" />
                    <span>Share</span>
                  </button>
                </div>
                <button className="bg-white border border-gray-300 text-gray-700 px-3 py-1 rounded-md text-sm">
                  Join Project
                </button>
              </div>
            </CardContent>
          </Card>
        ))}
      </div>
    </div>
  );
}
